import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import ProgressBar from '../pages/ProgressBar'; // Import the ProgressBar component
import '../css/FastPage.css';

const options = [
  { name: 'Student', img: 'data:image/jpeg;base64,' , alt: " 1"},
  { name: 'Professional', img: 'data:image/jpeg;base64,',alt: "2 "},
  { name: 'Parent', img: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTgTF2hVmkwTDTJdqhsFy94F6S7ddkbCE-uPQ&usqp=CAU',alt: " 3" },
  { name: 'Lifelong Learner', img: 'data:image/png;base64,',alt: "4 " },
  { name: 'Teacher', img: 'data:image/jpeg;base64,',alt: "5 " },
  { name: 'Other', img: 'data:image/jpeg;base64,' ,alt: "6"},
];

function FastPage({ currentPage }) { 
  const [selectedOption, setSelectedOption] = useState(null);
  const [progress, setProgress] = useState(14.2857); 
  const navigate = useNavigate();

  const handleOptionClick = (option) => {
    setSelectedOption(option.name);
  };

  const handleContinueClick = () => {
    setProgress(progress + 25); 
    navigate('/second');
  };

  return (
    <div className="FastPage">
      <ProgressBar progress={progress} /> 
      <h1>Please select an option that best describes you:</h1>
      
      <div className="options">
        {options.map((option, index) => (
          <div
            key={index}
            className={`option ${selectedOption === option.name ? 'selected' : ''}`}
            onClick={() => handleOptionClick(option)}
          >
            <img src={option.img} />
            <p>{option.name}</p>
          </div>
        ))}
      </div>

      <button disabled={!selectedOption} onClick={handleContinueClick}>Continue</button>
    </div>
  );
}

export default FastPage;
